import React from 'react';
import './Person.css';

const person = ( props ) => {
    return (
        <div onClick={props.click} className="person-wrapper">
            <h3>My name is {props.name} and I'm {props.age} years old</h3>
            <h4>Status: {props.status}</h4>
            <hr/>
            <input onChange={props.change} type="text" placeholder="change your status..."/>
        </div>
    );
}

export default person;
